import React from "react";

class CodeSearch extends React.Component {
  constructor(props) {
    super(props);
  }

  getFileData() {
    return this.props.code;
  }

  render() {
    return (
      <div>
        <div className="foundRepo">{this.props.name}</div>
        <h2>Code</h2>
        <ul>
          {this.getFileData().map((item, index) => (
            <li key={index}>
              File Name:{item.name}; Repository: {item.repository.name}
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default CodeSearch;
